import React from 'react';
import '../../css/PostCard.css';
import Img from '../../images/aerlux.png'
import {ProjectsData} from '../../service/ProjectsData'
 const TechStyle = {
  display:'inline-block'

 }
function Aerlux() {
  return ProjectsData.map((data,i) =>{
    return(
        <div  key={i} className="w3-col l12 ">
          <div className="w3-card-4 w3-margin w3-white">
            <img src={Img} alt="Norway"   className="PostImg"/>
            <div className="w3-container">
              <h3><b>{data.title}</b></h3>
             </div>      
            <div className="w3-container">
              <p>{data.description}</p>
                {data.tech.map((tech,i) => {
                    return(
                      <ul key={i} className="w3-ul w3-border" style={TechStyle} >
                        <li>{tech}</li>
                      </ul>
                    )})}
                <div className="w3-row">
                {data.demoLink ? 
                <div className="w3-col m12 s6">
                  <p><button className="w3-button  w3-white w3-border "><b> <a href={data.demoLink}>DEMO Â»</a></b></button></p>
                </div> : null }
                <div className="w3-col m12 s6">
                  <p><span className="w3-padding-large w3-right"><b><a href={data.surceCodeLink}>Source Code</a></b></span></p>
                </div>
              </div>
            </div>
          </div>
        </div>
    )
  })
}

export default Aerlux;
